            ctx->rc.buffer += *ctx->ptr;

        ctx->ptr++;

        ctx->rc.low    = (ctx->rc.low << 8)    | ((ctx->rc.buffer >> 1) & 0xFF);

        ctx->rc.range  <<= 8;

